import Menu from "../Menu/Menu";
import "./Cabecalho.css"

const Cabecalho = () => {
    return (<div>

        <div className="cabecalho">
            <div className="linha"></div>
            <Menu />
        </div>


    </div>);


}

export default Cabecalho;
